import {SAVE_INSTRUCTOR_REQUEST, FETCH_INSTRUCTOR_REQUEST, UPDATE_INSTRUCTOR_REQUEST, DELETE_INSTRUCTOR_REQUEST, FETCH_ALL_INSTRUCTORS,
    INSTRUCTOR_SUCCESS, INSTRUCTOR_FAILURE} from "./instructorTypes";

const initialState = {
    instructor: '', error: ''
};

const reducer = (state = initialState, action) => {
    switch(action.type) {
        case SAVE_INSTRUCTOR_REQUEST || FETCH_INSTRUCTOR_REQUEST || UPDATE_INSTRUCTOR_REQUEST || DELETE_INSTRUCTOR_REQUEST || FETCH_ALL_INSTRUCTORS:
            return {
                ...state
            };
        case INSTRUCTOR_SUCCESS:
            return {
                instructor: action.payload,
                error: ''
            };
        case INSTRUCTOR_FAILURE:
            return {
                instructor: '',
                error: action.payload
            };
        default: return state;
    }
};

export default reducer;
